    constructor(props) {
        super(props);
        this.state = {
            inputValue: 'Oh~',
            todoList: [],
        }
    }

    render() {
        return (
            <Fragment>
                <input value={this.state.inputValue} 
                onChange={this.handleChange.bind(this)}/>
                <button>submit</button>
                <ul>
                    <li>learning react</li>
                    <li>yo</li>
                </ul>
            </Fragment>
        );
    }

    handleChange(e) {
        console.log("event is here", e.target.value);
        this.setState(
            state.inputValue = e.target.value
